--
-- Table structure for table `crm_contact`
--

DROP TABLE IF EXISTS `crm_contact`;
CREATE TABLE `crm_contact` (
  `id` int(10) unsigned NOT NULL auto_increment COMMENT 'Unique Contact ID',
  `domain_id` int(10) unsigned NOT NULL default '0' COMMENT 'Which Domain owns this contact',
  `contact_type` enum('Individual','Organization','Household') default NULL COMMENT 'Type of Contact.',
  `legal_identifier` varchar(32) default NULL COMMENT 'May be used for SSN, EIN/TIN, Household ID (census) or other applicable unique legal/government ID.',
  `external_identifier` varchar(32) default NULL COMMENT 'Unique trusted external ID (generally from a legacy app/datasource). Particularly useful for deduping operations.',
  `sort_name` varchar(64) default NULL COMMENT 'Name used for sorting different contact types',
  `display_name` varchar(128) default NULL COMMENT 'Formatted name representing preferred format for display/print/other output.',
  `home_URL` varchar(128) default NULL COMMENT 'optional "home page" URL for this contact.',
  `image_URL` varchar(128) default NULL COMMENT 'optional URL for preferred image (photo, logo, etc.) to display for this contact.',
  `source` varchar(255) default NULL COMMENT 'where domain_id contact come from, e.g. import, donate module insert...',
  `preferred_communication_method` enum('Phone','Email','Post') default NULL COMMENT 'What is the preferred mode of communication.',
  `do_not_phone` tinyint(4) default '0',
  `do_not_email` tinyint(4) default '0',
  `do_not_mail` tinyint(4) default '0',
  `do_not_trade` tinyint(4) default '0',
  `hash` int(10) unsigned NOT NULL default '0' COMMENT 'Key for validating requests related to this contact.',
  PRIMARY KEY  (`id`),
  KEY `index_sort_name` (`sort_name`),
  KEY `domain_id` (`domain_id`),
  CONSTRAINT `crm_contact_ibfk_1` FOREIGN KEY (`domain_id`) REFERENCES `crm_domain` (`id`)
) TYPE=InnoDB;

