--
-- Table structure for table `crm_custom_field`
--

DROP TABLE IF EXISTS `crm_custom_field`;
CREATE TABLE `crm_custom_field` (
  `id` int(10) unsigned NOT NULL auto_increment COMMENT 'Unique Custom Field ID',
  `custom_group_id` int(10) unsigned NOT NULL default '0' COMMENT 'FK to crm_custom_group.',
  `name` varchar(64) default NULL COMMENT 'Variable name/programmatic handle for this property.',
  `label` varchar(64) default NULL COMMENT 'Text for form field label (also friendly name for administering this custom property).',
  `data_type` enum('String','Int','Float','Money','Memo','Date','Boolean','StateProvince','Country') default NULL COMMENT 'Controls location of data storage in extended_data table.',
  `html_type` enum('Text','TextArea','Select','Radio','CheckBox','Select Date','Select State/Province','Select Country') default NULL COMMENT 'HTML types plus several built-in extended types.',
  `default_value` varchar(255) default NULL COMMENT 'Use form_options.is_default for field_types which use options.',
  `is_required` tinyint(4) default NULL COMMENT 'Is a value required for this property.',
  `weight` int(11) NOT NULL default '1' COMMENT 'Controls field display order within an extended property group.',
  `validation_id` int(10) unsigned default NULL COMMENT 'FK to crm_validation. Will be used for custom validation functions.',
  `help_pre` text COMMENT 'Description and/or help text to display before this field.',
  `help_post` text COMMENT 'Description and/or help text to display after this field.',
  `mask` varchar(64) default NULL COMMENT 'Optional format instructions for specific field types, like date types.',
  `attributes` varchar(255) default NULL COMMENT 'Store collection of type-appropriate attributes, e.g. textarea  needs rows/cols attributes',
  `javascript` varchar(255) default NULL COMMENT 'Optional scripting attributes for field.',
  `is_active` tinyint(4) default NULL COMMENT 'Is this property active?',
  PRIMARY KEY  (`id`),
  UNIQUE KEY `UI_label_custom_group_id` (`label`,`custom_group_id`),
  UNIQUE KEY `UI_name_custom_group_id` (`name`,`custom_group_id`),
  KEY `custom_group_id` (`custom_group_id`),
  KEY `validation_id` (`validation_id`),
  CONSTRAINT `crm_custom_field_ibfk_1` FOREIGN KEY (`custom_group_id`) REFERENCES `crm_custom_group` (`id`),
  CONSTRAINT `crm_custom_field_ibfk_2` FOREIGN KEY (`validation_id`) REFERENCES `crm_validation` (`id`)
) TYPE=InnoDB;

